import React, { Component } from 'react'

export class AddTodo extends Component {
    render() {
        return (
            <form style={{ display: 'flex', flexDirection: 'horizontal'}}>
                <input 
                    type='text' 
                    placeholder='Add Todo...'
                />
                <input type='submit' />
            </form>
        )
    }
}

export default AddTodo
